import React from 'react';
import { BrowserRouter as Router, NavLink } from 'react-router-dom';
import Contact from './Contact';

export default function NavBar() {
    return (
        <div>
            <p>NavBar component</p>
                <Router>
                    <NavLink exact={"true"} to="/contact">
                        Contact
                    </NavLink>
                </Router>
        </div>
    );
}
